(53, 'Playera Deportiva Colores 100% Poliester', '>>> NO SE TRANSPARENTA <<<\n>>> PLAYERA ANTITRANSPIRANTE <<<\nSOMOS FABRICANTES DIRECTOS!\nLa mejor calidad en el mercado!\n#UnaNuevaYMejorOpciónEnPlayeras\n\n*** Etiqueta fácilmente desprendible para que la uses con tu marca personalizada!\n\n++PLAYERA NUEVA UNISEX MANGA CORTA CUELLO REDONDO, PESO COMPLETO 100% POLIESTER\n\nENVIO GRATIS.... mercado libre modificó sus condiciones de envío gratis, ahora depende directamente de tu cuenta, la cantidad y tu código postal, pero ese dato solo te aparece a ti, al ir aumentando la cantidad te va apareciendo cuanto es de envío\n\nMAYOREO.... Escríbenos en los mensajes de tu compra que te interesa comprar de mayoreo.\n\n***MEDIDAS DE LAS TALLAS***\n\n------------------------------------------------------------\nPLAYERAS DE CABALLERO\n------------------------------------------------------------\nANCHO LARGO\nCHICA 46cm 71cm\nMEDIANA 51cm 73cm\nGRANDE 56cm 75cm\nEXTRAGRANDE 61cm 78cm', 'Mochilas', 85, 206, 3, 'https://articulo.mercadolibre.com.mx/MLM-940426235-playera-deportiva-colores-100-poliester-antitranspirante-_JM#reco_item_pos=3&reco_backend=machinalis-domain-pads_pdp_off&reco_backend_type=low_level&reco_client=vip-pads&reco_id=094ccfa0-6615-4573-9d49-eb3f4ae4d103&is_advertising=true&ad_domain=VIPCORE_RECOMMENDED&ad_position=4&ad_click_id=NWQwNGMwZWUtZjk5NS00NjNmLTg2ZjAtMWQ5OTg0YTlkNGRl', 5, NULL),
(56, 'Crash Bandicoot: N. Sane Trilogy Standard', 'Es nueva', 'Mochilas', 873, 36, 3, 'https://articulo.mercadolibre.com.mx/MLM-934459508-crash-bandicoot-n-sane-trilogy-standard-edition-fisico-ps4-_JM#reco_item_pos=0&reco_backend=promotions-sorted-by-score-mlm-A&reco_backend_type=low_level&reco_client=home_seller-promotions-recommendations&reco_id=a2fb4750-36dc-456d-89da-9e982b5851d8&c_id=/home/promotions-recommendations/element&c_element_order=1&c_uid=f1d3e650-82b6-4733-a398-e70d570b9821&gid=1&pid=1', 4, NULL),
(57, 'Watch Dogs 2 Standard Edition Ubisoft', 'Con este juego de Watch Dogs vas a disfrutar de horas de diversión y de nuevos desafíos que te permitirán mejorar como gamer.\n\nInteractúa con otros jugadores\nPodrás disfrutar de una experiencia inigualable, ya que te permite jugar con tus amistades y compartir momentos inolvidables.\n\nDiversión sin fronteras\nPodrás compartir cada juego con personas de todo el mundo, ya que es posible conectarse de manera online.', 'Mochilas', 347, 3, 3, 'https://www.mercadolibre.com.mx/watch-dogs-2-standard-edition-ubisoft-ps4-fisico/p/MLM6304042#reco_item_pos=7&reco_backend=machinalis-homes-pdp-boos&reco_backend_type=function&reco_client=home_navigation-recommendations&reco_id=88130b5f-476b-4174-b2cc-775e2f3c30bf&c_id=/home/navigation-recommendations/element&c_element_order=8&c_uid=c5a6608a-9b62-4cf8-b153-353dcb6bb96d', 4, NULL),
