(62, 'Razer BlackWidow X Chroma Mercury Edition', 'Diseñados específicamente para video juegos, los Interruptores Mecánicos Razer actúan a una distancia óptima, proporcionándole velocidad y capacidad de respuesta como nunca antes; Ultrapolling de 1000 Hz\nCon una fabricación y un diseño internos completos, Razer garantiza que se cumplan requisitos aún más estrictos para cada interruptor producido, lo que da como resultado una vida útil de hasta 80 millones de golpes de tecla. Requisitos del sistema: Windows 10, Windows 8, Windows 7 y Mac OS X (v10.8 - 10.11)\nEl Razer BlackWidow X Chroma le permite ejecutar perfectamente hasta diez comandos al mismo tiempo, cada vez\nEl Razer BlackWidow X Chroma cuenta con teclas retro iluminadas programables individualmente con 16,8 millones de opciones de color, todas configuradas fácilmente con Razer Synapse\nPuede sincronizar todos sus periféricos habilitados con Razer Chroma para que pueda ver su teclado, auriculares, mouse e incluso la alfombrilla del mouse cobrar vida como uno', 'Mochilas', 3500, 12, 1, 'Vacio', 4, NULL),
(63, 'POWZAN Teclado con luz', 'Menos ruido y tecla responsable: el interruptor único de tijeras altas permite una escritura silenciosa y eficiente, excelente para su uso diario, especialmente en comparación con un teclado mecánico ruidoso. Silencioso pero proporciona una escritura cómoda y suave y clic.\nRetroiluminación LED espléndida con letras claras: en la oscuridad, puedes ver las letras claramente con letras iluminadas en las teclas. También puedes ajustar el brillo de acuerdo a tu preferencia. Las teclas fáciles de leer toman una posición prominente en tu escritorio y se mantendrán ahí las 24 horas del día.\nTecnología avanzada antigafe y función de bloqueo de viento: este teclado retroiluminado LED permite que la mayoría de 19 teclas funcione simultáneamente con alta velocidad. Al pulsar FN Win Lock, puede bloquear la función Win para evitar presionarlo por error para jugar. El teclado traerá la mejor y rápida experiencia de juego.\nTeclas multimedia sobre la marcha: teclado con cable de tamaño completo de 104 teclas con teclado numérico y teclas multimedia. Los atajos te permiten hacer más con menos esfuerzos durante el juego. Disfruta de la comodidad al alcance de tu mano.\nCompatibilidad Plug and Play y servicio fiable: compatible con Windows XP, Vista, 7, 8 y 10; conexión USB con cable; no hay necesidad de descargar e instalar ningún software o controladores en tu dispositivo antes de usarlo. Powzan promete proporcionar el mejor servicio al cliente. Si por cualquier razón no estás completamente satisfecho, te devolveremos tu dinero 100%.', 'Mochilas', 790.8, 12, 1, 'Vacio', 4, NULL),
(64, 'Bocinas multimedia RoundEdge 70 W PMPO', 'Dale más potencia de audio a tu PC o laptop con estas bocinas. Son compactas y gracias a su diseño combinan perfecto con cualquier equipo. \n\nTienen control independiente de volumen que te permitirá hacer ajustes rápidos al nivel que tú desees, con una potencia de 70 WPMPO. \n\nSu instalación es muy sencilla; sólo conéctalas a la salida de audífonos y a cualquier puerto USB de tu computadora y listo, no necesitas ningún controlador o software extra. \n\nEstán fabricadas con plástico ABS resistente al impacto, con detalles en color azul alrededor del cono. ', 'Mochilas', 399, 1321, 1, 'Vacio', 4, NULL);

